// Accepted --- 104ms 40MB 26.52%
const hasGroupsSizeX = (deck) => {
    if (deck.length <= 1) return false;
    let element = [...new Set(deck)];
    let freq = [];
    for (const e of element) {
        freq.push(getFrequency(deck, e));
    }
    let unique = [...new Set([...freq])];
    // console.log(freq);
    // if (unique.length == 1 || isAllEven(freq) || isAllMultiple(unique)) return true;
    if (unique.length == 1 || check(unique)) return true;
    return false;
};

const check = (arr) => {
    arr.sort((a, b) => a - b);
    let first = arr[0];
    if (first == 1) return false;
    for (let i = 2; i <= first; i++) {
        if (arr.every(x => x % i == 0)) return true;
    }
    return false;
};

